package com.boredream.AlgBase;


import java.util.Arrays;

public class Sort {

    public static void main(String[] args) {

        char[] charArray = "".toCharArray();
        charArray = "837491526".toCharArray();
        for (int i = 1; i <= 9; i++) {
            System.out.println(kthHigh(charArray, i));
        }
        System.out.println(Double.toHexString(1.2));
    }

    private static char kthHigh(char[] charArray, int k) {
        return kthHigh(charArray, k, 0, charArray.length - 1);
    }

    private static char kthHigh(char[] charArray, int k, int start, int end) {
        // 首位作为比较
        char comppare = charArray[start];
        // 从次卫到末尾，左右分割，小的左，大的右
        int lo = start;
        int high = end;
        while (true) {
            while (charArray[lo] <= comppare && lo < end) lo++;
            while (charArray[high] > comppare && high > start) high--;
            if (lo >= high) break;
            exchange(charArray, lo, high);
        }
        exchange(charArray, start, high);
        // 已经分左右了，kth大的看当前分割的位置，如果正好是 length - k 个数，就返回，否则继续找左或右半边即可
        if (high > charArray.length - k) {
            // 继续从左边找
            return kthHigh(charArray, k, start, high - 1);
        } else if (high < charArray.length - k) {
            // 从右边找
            return kthHigh(charArray, k, high + 1, end);
        } else {
            return charArray[high];
        }
    }

    private static void sortWithTime(char[] charArray) {
        long start = System.currentTimeMillis();
        System.out.println(charArray);
        shellSort(charArray);
        System.out.println(System.currentTimeMillis() - start);
        System.out.println(charArray);
    }

    // 选择排序
    public static void chooseSort(char[] charArray) {
        // 每次循环获取最小数，然后和第一个数交换
        // 每轮结束后指针下移 O(n^2)
        for (int i = 0; i < charArray.length; i++) {
            int minIndex = i;
            for (int j = i + 1; j < charArray.length; j++) {
                if (charArray[j] < charArray[minIndex]) {
                    minIndex = j;
                }
            }
            exchange(charArray, minIndex, i);
        }
    }

    // 插入排序
    public static void insertSort(char[] charArray) {
        // 依次往后循环检索新数据
        // 新数据再依次向前遍历，如果比前一个小就交换下，直到交换到刚好比前一个数字大的位置
        for (int i = 1; i < charArray.length; i++) {
            for (int j = i; j > 0 && charArray[j] < charArray[j - 1]; j--) {
                exchange(charArray, j, j - 1);
            }
        }
    }

    // 希尔排序 （插入排序的进化版）
    public static void shellSort(char[] charArray) {
        int h = 1;
        while (h < charArray.length / 3) h = h * 3 + 1;
        // 用 h * 3 + 1 是保证间隔数字是质数，防止公约数重复
        // 如果是简单 * 2，那么第一轮比如是间隔8，第二轮间隔4，每两个间隔还是会重复第一轮已经重排的数字，浪费，所以~
        while (h >= 1) {
            for (int i = h; i < charArray.length; i++) {
                for (int j = i; j >= h && charArray[j] < charArray[j - h]; j -= h) {
                    exchange(charArray, j, j - h);
                }
            }
            h = h / 3;
        }
    }

    // 归并排序
    public static void mergeSort(char[] charArray) {
        // 利用分治法的思想，最基本的step是merge，即可以把两个「有序」的小数组，合并成一个「有序」的大数组
        // 迭代重复这个步骤，就可以搞定了
        mergeSort(charArray, 0, charArray.length - 1);
    }

    // 归并排序 - 递归用
    public static void mergeSort(char[] charArray, int lo, int hi) {
        // 每次把集合拆分成两部分，分别处理，然后合并
        if (lo >= hi) return;
        int mid = lo + (hi - lo) / 2;
        mergeSort(charArray, lo, mid);
        mergeSort(charArray, mid + 1, hi);
        merge(charArray, lo, mid, hi);
    }

    // 归并（无法直接把整个集合排序）
    public static void merge(char[] charArray, int lo, int mid, int hi) {
        // 低中高仨指针，mid将集合分成两部分，两边起始位置各一个指针，每次对比边两边指针的数字，小的添加到左边，大的右边
        int i = lo;
        int j = mid + 1;

        System.out.println("merge " + lo + " - " + hi);
        char[] arrayCopy = Arrays.copyOf(charArray, charArray.length);

        for (int k = lo; k <= hi; k++) {
            if (i > mid) {
                // i 到头了，累加 j
                charArray[k] = arrayCopy[j++];
            } else if (j > hi) {
                // j 到头了，累加 i
                charArray[k] = arrayCopy[i++];
            } else if (arrayCopy[i] < arrayCopy[j]) {
                // 小的放左边
                charArray[k] = arrayCopy[i++];
            } else {
                // 大的放右边
                charArray[k] = arrayCopy[j++];
            }
        }
    }

    // 快速排序
    public static void quickSort(char[] charArray) {
        // 跟归并法一样，利用分治的概念，但是是先保证两个大集合，左半边都小于右半边，依次二分下去
        quickSort(charArray, 0, charArray.length - 1);
    }

    public static void quickSort(char[] charArray, int lo, int hi) {
        if (lo >= hi) return; // 递归一定要有结束条件
        int j = partition(charArray, lo, hi);
        // 以参照数位置为准，再次二分，j的位置一定正确，不用再加入排序
        quickSort(charArray, lo, j - 1);
        quickSort(charArray, j + 1, hi);
    }

    private static int partition(char[] charArray, int lo, int hi) {
        // 取一个参照数，将所有小于它的都放在集合左边，大于的放在右边
        int i = lo;
        int j = hi + 1;
        char v = charArray[lo]; // 取第一个位置内容作为参照
        while (true) {
            while (charArray[++i] < v && i < hi) ; // 从第二位置开始遍历~
            while (charArray[--j] > v && j > lo) ; // 从最后一个位置开始遍历~
            if (i >= j) break;
            exchange(charArray, i, j);
        }
        exchange(charArray, lo, j);
        // 返回参照数位置
        return j;
    }

    // 快速排序，第二种方法
    private static void quickSort2(char[] charArray) {
        quickSort2(charArray, 0, charArray.length - 1);
    }

    private static void quickSort2(char[] charArray, int start, int end) {
        if (start >= end - 1) return; // start超过end，或者start只是在end前一位，没必要再排序
        char compare = charArray[start]; // step1.取第一个值作为比较目标
        int swapIndex = start + 1;
        for (int i = start + 1; i <= end; i++) {
            // step2.挨个比较后面所有的值，比他小的放左边，比他大的放右边
            // 左右分大小算法，使用一个swapIndex记录位置，每次发现小的了交换该位置并+1
            char target = charArray[i];
            if (target < compare) {
                exchange(charArray, swapIndex++, i);
            }
        }
        // step3.遍历完以后，交换对比位置数据和swapIndex-1。即对比数据左右分为两组，分别小于以及大于等于自己
        exchange(charArray, start, swapIndex - 1);

        // step4.之后对拆成两半的两组集合再次进行如上的操作，swapIndex-1是比较值，固定不动
        quickSort2(charArray, start, swapIndex - 2);
        quickSort2(charArray, swapIndex, end);
    }

    private static void exchange(char[] charArray, int i, int j) {
        char temp = charArray[i];
        charArray[i] = charArray[j];
        charArray[j] = temp;
    }
}
